import React from 'react';
import './SkeletonMyPagesInSider.css';

function SkeletonMyPagesInSider() {
  return (<React.Fragment>
    <li className="skeleton-item">
      <div>
        <div className="skeleton-img-30"/>
      </div>
      <div className="skeleton-info">
        <p className="skeleton-name"/>
        <p className="skeleton-email"/>
      </div>
    </li>
  </React.Fragment>)
}

export default SkeletonMyPagesInSider;
